import React from 'react';

const Videoitem = props => (

    <li key={props.video.id}>
        <img src={props.video.snippet.thumbnails.default.url} alt="이미지"/>
        <p>
            {props.video.snippet.title}

        </p>
    </li>

)
export default Videoitem;
